  return (
    <nav className={styles.nav}>
      {isLoggedin && <Link to="/favorites">Favs</Link>}
      {isLoggedin && (
        <Link to="/" onClick={() => setisLoggedin(false)}>
          Logout
        </Link>
      )}
      {isLoggedin }
    </nav>
  );
}

export default Navbar;
